svg.script:
  document.addEventListener("DOMContentLoaded", animate);
  function animate(e) {
   var w1n = document.getElementById('w1n');
   var w2n = document.getElementById('w2n');
   var w3n = document.getElementById('w3n');
   var w1c = document.getElementById('w1c');
   var w2c = document.getElementById('w2c');
   var w3c = document.getElementById('w3c');
   var l = 2000; var t = 16; var d = -1; var s = 0; var x = 0;
   var w1l = -2; var w2l = -5; var w3l = 2

	w1c.setAttribute('transform', 'matrix(1.4 0.2 0.2 1.1 0 0)')
   setInterval(function () {
     if(window.getComputedStyle(w1c).getPropertyValue('animation-play-state')=='paused'){return true}
	 if(s >= l || s<=0) d=d*-1

	 //scale points relative to vector (v1,v2) starting from point (c1,c2)
	 //x1_new = c1 - c1 s - (c1 v1^2)/(v1^2 + v2^2) + (c1 s v1^2)/(v1^2 + v2^2) - (c2 v1 v2)/(v1^2 + v2^2) + (c2 s v1 v2)/(v1^2 + v2^2) + (s + v1^2/(v1^2 + v2^2) - (s v1^2)/(v1^2 + v2^2)) x1 + ((v1 v2)/(v1^2 + v2^2) - (s v1 v2)/(v1^2 + v2^2)) x2
	 //x2_new = c2 - c2 s - (c1 v1 v2)/(v1^2 + v2^2) + (c1 s v1 v2)/(v1^2 + v2^2) - (c2 v2^2)/(v1^2 + v2^2) + (c2 s v2^2)/(v1^2 + v2^2) + ((v1 v2)/(v1^2 + v2^2) - (s v1 v2)/(v1^2 + v2^2)) x1 + (s + v2^2/(v1^2 + v2^2) - (s v2^2)/(v1^2 + v2^2)) x2
	 var z = x*w1l
	 w1n.textContent = (z>=0 ? ' ' : '')+z.toFixed(1)
	 z = -z*0.2*113.63636
	 w1c.setAttribute('transform', 'matrix(1.4 0.2 0.2 1.1 '+(z-200)+' '+(-2*z-100)+')');
	 z = x*w2l
	 w2n.textContent = (z>=0 ? ' ' : '')+z.toFixed(1)
	 z = -z*0.2*113.63636
	 w2c.setAttribute('transform', 'matrix(1.1 -0.2 -0.2 1.4 '+(-2*z)+' '+(-z)+')')
	 z = x*w3l
	 w3n.textContent = (z>=0 ? ' ' : '')+z.toFixed(1)
	 z = -z/1.04*113.63636
	 w3c.setAttribute('transform', 'translate('+(0.2*z)+','+(1*z)+')');

	 s=s+d*t; x=Math.min(1, Math.max(0, s/l))
    }, t)
}
